import React, { Component } from "react";
import { FaRunning, FaCompactDisc, FaPlayCircle} from "react-icons/fa";
import 'bootstrap/dist/css/bootstrap.min.css';
import './index.css';
import { Switch, Route } from "react-router-dom";

import Tabata from "./Tabata";
import Music from "./Music";
import Library from "./Library";

class Main extends Component {
    render() {
        return (
            <div>
                <div className="waveWrapper waveAnimation">
                    <div className="waveWrapperInner bgTop">
                        <div className="wave waveTop"/>
                    </div>
                    <div className="waveWrapperInner bgMiddle">
                        <div className="wave waveMiddle"/>
                    </div>
                    <div className="waveWrapperInner bgBottom">
                        <div className="wave waveBottom"/>
                    </div>
                </div>
                <Switch>
                    <Route exact path="/" component={Tabata} />
                    <Route path="/music" component={Music} />
                    <Route path="/music" component={Library} />
                </Switch>
            </div>

        );
    }
}

export default Main;
